import React, { useState } from "react";
import { Link } from "react-router-dom";
import { config, library } from "@fortawesome/fontawesome-svg-core";
import "./Home.css";
import "@fortawesome/fontawesome-svg-core/styles.css";

config.autoAddCss = false; 

const Home = () => {
  const [data, setData] = useState([
    { id: 1, proprietaire: 'user1', categorie: 'A',marque:'Toyota', etat: 'tsara' },
    { id: 2, proprietaire: 'user2', categorie: 'B', marque:'Nissan',etat: 'neuf' },
  ]);
  const [editMode, setEditMode] = useState(null);

  const handleEdit = (id) => {
    setEditMode(id);
  };

  const handleSave = (id) => {
    setEditMode(null);
    // Implémentez la logique pour sauvegarder les modifications ici
  };

  const handleDelete = (id) => {
    setData(data.filter((item) => item.id !== id));
  };

  return (
    <div className="container">
    <h1 className="heading">Liste des Annonces</h1>

    <table>
      <thead>
        <tr>
          <th>Proprietaire</th>
          <th>Categorie</th>
          <th>Etat</th>
          <th>Marque</th>
        </tr>
      </thead>
      <tbody>
        {data.map((row) => (
          <tr key={row.id}>
            <td>
              {editMode === row.id ? (
                <input
                  type="text"
                  value={row.proprietaire}
                  onChange={(e) =>
                    setData((prevData) =>
                      prevData.map((item) =>
                        item.id === row.id
                          ? { ...item, proprietaire: e.target.value }
                          : item
                      )
                    )
                  }
                />
              ) : (
                row.proprietaire
              )}
            </td>
            <td>
              {editMode === row.id ? (
                <input
                  type="text"
                  value={row.categorie}
                  onChange={(e) =>
                    setData((prevData) =>
                      prevData.map((item) =>
                        item.id === row.id
                          ? { ...item, categorie: e.target.value }
                          : item
                      )
                    )
                  }
                />
              ) : (
                row.categorie
              )}
            </td>
            <td>
              {editMode === row.id ? (
                <input
                  type="text"
                  value={row.etat}
                  onChange={(e) =>
                    setData((prevData) =>
                      prevData.map((item) =>
                        item.id === row.id
                          ? { ...item, etat: e.target.value }
                          : item
                      )
                    )
                  }
                />
              ) : (
                row.etat
              )}
            </td>
            <td>
              {editMode === row.id ? (
                <input
                  type="text"
                  value={row.marque}
                  onChange={(e) =>
                    setData((prevData) =>
                      prevData.map((item) =>
                        item.id === row.id
                          ? { ...item, marque: e.target.value }
                          : item
                      )
                    )
                  }
                />
              ) : (
                row.etat
              )}
            </td>
            <td>
              {editMode === row.id ? (
                <button onClick={() => handleSave(row.id)}>Enregistrer</button>
              ) : (
                <>
                  <button onClick={() => handleEdit(row.id)}>Modifier</button>
                  <button onClick={() => handleDelete(row.id)}>Supprimer</button>
                </>
              )}
            </td>
          </tr>
        ))}
      </tbody>
    </table>
    </div>
  );
};

export default Home;
